import React from 'react';

import RowTable from './RowTable'

function TableList (props){
    
    return(
    <React.Fragment>
        <table>
              <thead>
                <tr>
                {
                    props.columnName.map((name, index) => {
                        if (name === 'uid' || name === 'name' || name === 'isTemplate' || name === 'isDeleted') {
                            return <th key={index}> {name} </th>
                        }
                    })
                }
                </tr>
              </thead>

              <tbody>
                {
                    props.dataTable.map((data, index) => {
                        for (keyObj in data) {
                            if (keyObj === 'uid' || keyObj === 'name' || keyObj === 'isTemplate' || keyObj === 'isDeleted') {
                                return <RowTable
                                                dataRow={data}
                                                key={index}
                                                onclick={props.onclick}
                                            />
                            }
                        }

                    })
                }
                </tbody>
        </table>
    </React.Fragment>
    )
}

export default TableList
